Hitlers Architect

War Documentary hosted by Alan Cordunner, published by National Geographic broadcasted as part of NG Nazi Underworld series in 2011 - English narration


Information
------------------------------

Albert Speer was HItler's personal architect and successful armaments minister, who managed to convince the world of his innocence of the Holocaust. Over 30 years after his death, historians have unearthed documents proving that the &quot;good Nazi&quot; not only covered up his knowledge of the Holocuast, but also participated in the Nazi art theft.

